//This is a procedure in which user has to define the behaviour of columns selector state.
//You can save the ColumnsSelector state in session, database or whatever you want.
//By default, it calls to LoadUserKeyValue Procedure in order to have the same mechanism in all the end users configurations
LoadUserKeyValue(&UserCustomKey, &UserCustomValue)

//This is a procedure in which user has to define the behaviour of columns selector state.
//You can save the ColumnsSelector state in session, database or whatever you want.
